- input: "TEXT\x1CC00023580\x1C2\x1CB451227\x1CSB21B\x1C\"The NALC is affiliated with
    the AFL-CIO.  This disbursement represents a repayment of payroll and travel related
    costs for an AFL-CIO 'get out the vote' campaign.  The AFL-CIO 'get out the vote'
    campaign consisted of communications directed solely to members of the AFL-CIO
    and their families.  Because the PAC is not equipped to process payroll and its
    related liabilities, the union processed the payroll, processed related travel
    expenses claimed by participants and billed these costs back to the PAC.  The
    'get out the vote' campaign was not a fundraising campaign and had no connection
    to fundraising for any candidate or campaign.\"\n"
